module.exports = async d => {
    const code = d.command.code

    const r = code.split("$memberExists[").length - 1

    const inside = code.split("$memberExists[")[r].split("]")[0]

    const member = await d.message.guild.members.fetch(inside).catch(err => {})

    return {
        code: code.replaceLast(`$memberExists[${inside}]`, typeof member === "object")
    }
}